import React, { Component } from 'react';
import '../App.css';

class TraitementEnCours extends Component {

  render() {
    return (
      <div className="containerDropZone">
        <aside className="tab">
          <h4>Fichiers en traitement :</h4>
        </aside>
      </div>
    );
  }

}

export default TraitementEnCours;
